import { Container } from "react-bootstrap";

export function Home() {
    return (
      <main id="Home">
        <Container className="jumbotron">
          <blockquote>For Frodo!</blockquote>
          <p>The Lord Of The Rings and all of the legendarium that <a href="https://www.tolkienestate.com/life/biography/" target="_blank">J.R.R. Tolkien</a> created is amazing.</p>
          <p>Here you will see a showcase of a few of Tolkien's works, and as a fan myself, I am very fond of it. And if you want to check out how I designed it, please visit my <a href="https://github.com/jufb/lordoftherings" target="_blank">GitHub</a> account!</p>
          Thank you!
        </Container>
      </main>
    );
  }
